import React, {memo} from "react";

const Todo = memo(props =>{
    const { todo } = props

    return(
        <li>
            <div className="view">
                <input className="toggle" checked= {todo.isCompleted} />
                <label>{Todo.text}</label>
                <button className="destroy"></button>
            </div>
        </li>
    )
})

export default Todo
